The gauge is incremented in one of the following scenarios:
  - When a new subscriber registers on the MME, the MME successfully performs the SMS in MME registration for the subscriber.
  - A subscriber has already registered on the MME without the SMS in MME registration. Later, in the mobility procedure the MME successfully performs the SMS in MME registration for the subscriber, for example, when the UE requests SMS service and/or the configuration changes.
  - A subscriber reattaches to the MME after a proper detach, and the MME had successfully performed the SMS in MME registration for the subscriber in the previous registration.

The gauge is decremented in one of the following scenarios:
  - The MME sends a Notify Request message with the Removal of MME Registration for SMS bit set in the NOR-Flags AVP, to the HSS.
  - The MME receives an Insert Subscriber Data Request message with the Remove SMS Registration bit set in the IDR-Flags AVP, from the HSS.
  - A subscriber moves to another SGSN-MME.
  - A subscriber is detached.');

