Action to be taken if the measurement exceeds its supervised threshold: 
If there is an indication of high #CPU# load for a longer period of time, troubleshoot to find the reason for the high #CPU# load. 
One remedy can be to offload the #SGSN-MME#, for example, by reconfiguring and moving part of the traffic to another interface, or by moving one or more #BSC#s, #RNC#s, or #eNodeB#s to a less loaded #SGSN-MME#. Overload can also occur in a recovery phase, for example, after a restart. In this case, no action is required.');

