The SGSN-MME has the following limits on route numbers: 
- The SMXB supports a maximum of 40,000 IPv4 routes in the forwarding table of each LC. 
- The SMXB has no limit on the number of IPv4 routes in the forwarding table of each IP network.
- Virtual SGSN-MME supports a maximum of 256 static IPv4 routes per vLC and VPN.
- Virtual SGSN-MME supports a maximum of 1,024 static IPv4 routes per vLC.
Exceeding these limits causes loss of connectivity.

Do the following when the measurement exceeds its supervised threshold:
- Reduce the number of static routes configured on the SGSN-MME.
- Reduce the number of routes exported to the SGSN-MME from external routers.
- If OSPF is used, consider using OSPF NSSA to reduce the number of routes.

Note: When this measurement is used on virtual SGSN-MME, the default alarm-triggering level is 250 and the default alarm-clearing level is 240.');

