INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_attpagingforcssr_e','vs_geored_attpagingforcssr_e',8,'counter','integer','CC','0','This measurement provides the number of attempted PS paging procedures initiated by the MME for MSC Triggered CS Service Restoration (CSSR). The counter is incremented when a PS paging procedure is started after UE Backup Retrieval procedure upon receipt of the SGsAP Paging Request message from the MSC with IMSI. It could happen after the serving MME is restarted and the UE CS/PS service has not been restored on the MME, or the SGsAP Paging Request is sent to an alternative MME in the pool. The counter is incremented at the sending of the paging message with the current S-TMSI in the procedure.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_attpagingforcssr_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.AttPagingForCSSR.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_attpagingforntsr_e','vs_geored_attpagingforntsr_e',9,'counter','integer','CC','0','This measurement provides the number of attempted PS paging procedures initiated by the MME for Network Triggered Service Restoration (NTSR). The counter is incremented when a PS paging procedure is started upon receipt of the Downlink Data Notification message from the SGW with IMSI. The counter is incremented at the sending of the paging message with the current S-TMSI in the procedure. Paging attempts for low-complexity UEs are also included.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_attpagingforntsr_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.AttPagingForNTSR.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_attpagingfortdr_e','vs_geored_attpagingfortdr_e',10,'counter','integer','CC','0','This measurement provides the number of attempted PS paging procedures initiated by the MME for UE restoration upon Mobile-Terminated Non-IP Data Delivery over the SCEF. The counter is incremented each time the MME initiates a PS paging procedure when receiving an MT-Data-Request message from the SCEF. Paging attempts for low-complexity UEs are also included in this measurement.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_attpagingfortdr_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.AttPagingForTDR.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_attachthrottlingnonreservedgranted_e','vs_geored_attachthrottlingnonreservedgranted_e',11,'counter','integer','CC','0','This measurement provides the number of Update Location Request (ULR) and Authentication Information Request (AIR) messages due to the UE Restoration procedure that have been accepted by the Attach throttle using the non-reserved allowance. The non-reserved allowance is the difference between the total Attach throttle allowance, specified by the MMEAttachThrottlingAttachRateLimit parameter, and the sum of the reserved allowances, specified by the MMEAttachThrottlingReservedLimitAttach and MMEAttachThrottlingReservedLimitGeoredRestore parameters. ULR and AIR messages accepted using the reserved Geored allowance specified by the MMEAttachThrottlingReservedLimitGeoredRestore parameter are not counted.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_attachthrottlingnonreservedgranted_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.AttachThrottlingNonReservedGranted.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_ddnimsiatt_e','vs_geored_ddnimsiatt_e',12,'counter','integer','CC','0','This measurement provides the number of the received Downlink Data Notification (DDN) messages with IMSI. This counter is incremented each time a DDN message with IMSI is received from the SGW.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_ddnimsiatt_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.DdnImsiAtt.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_ddnimsisucc_e','vs_geored_ddnimsisucc_e',13,'counter','integer','CC','0','This measurement provides the number of successful Downlink Data Notification Acknowledge with IMSI. This counter is incremented each time a Downlink Data Notification  Acknowledge message with IMSI and the cause "Request accepted" is sent out.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_ddnimsisucc_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.DdnImsiSucc.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_pagingavoidedduetoueinedrx_e','vs_geored_pagingavoidedduetoueinedrx_e',14,'counter','integer','CC','0','This measurement provides the number of paging procedures in EPS that have been avoided due to the UE being in eDRX during UE restoration upon the DDN with IMSI procedure or CS Service Restoration or Mobile-Terminated Non-IP Data Delivery over the SCEF in Geographically redundant pool. The counter is increased when paging is needed, but cannot be performed since the UE is in eDRX and not in paging time window.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_pagingavoidedduetoueinedrx_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.PagingAvoidedDueToUeInEdrx.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_s6ablockbythrottle_e','vs_geored_s6ablockbythrottle_e',15,'counter','integer','CC','0','This measurement provides the number of S6a messages blocked due to the Attach Throttling function in the geographically redundant pool. The counter is incremented when an S6a message is blocked because the number of messages under throttling control exceeds the available allowance. The available allowance for Geographically Redundant UE Restoration messages is the difference between the total Attach throttle allowance, specified by the MMEAttachThrottlingAttachRateLimit parameter and the reserved allowance for E-UTRAN attach procedures, specified by the MMEAttachThrottlingReservedLimitAttach parameter.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_s6ablockbythrottle_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.S6aBlockByThrottle.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_sgspagingrelayrecd_e','vs_geored_sgspagingrelayrecd_e',16,'counter','integer','CC','0','This measurement provides the number of Echo Request messages with the "SGs Paging Request" operation code received over the S10 interface. This counter is incremented each time the MME receives an Echo Request message with the "SGs Paging Request" operation code over the S10 interface.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_sgspagingrelayrecd_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.SgsPagingRelayRecd.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_sgspagingrelaysent_e','vs_geored_sgspagingrelaysent_e',17,'counter','integer','CC','0','This measurement provides the number of Echo Request messages with the "SGs Paging Request" operation code sent over the S10 interface. This counter is incremented each time the MME sends an Echo Request message with the "SGs Paging Request" operation code over the S10 interface.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_sgspagingrelaysent_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','SGSN-MME_GeographicallyRedundantPool','VS.GeoRed.SgsPagingRelaySent.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_GEOGRAPHICALLYREDUNDANTPOOL:vs_geored_uebackupcreaterecd_e','vs_geored_uebackupcreaterecd_e',18,'counter','integer','CC','0','This measurement provides the number of UE geo-replica creation messages received. This counter is incremented each time the Replication MME receives an Echo Request message over the S10 interface with the operation code "Backup Required".');
