INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_IRATHO_E:vs_iratho_fromumtsfailintraduetoapnrestriction_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_IRATHO_E','SGSN-MME_Mobility_IRATHO_E','VS.IRATHO.FromUmtsFailIntraDueToApnRestriction.E');
