INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachlapiatt_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachLapiAtt.E');
