INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachnascongestioncontrolrejected_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachNasCongestionControlRejected.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachrejectduetoapnrestriction_e','vs_mm_attachrejectduetoapnrestriction_e',35,'counter','integer','CC','0','This measurement provides the number of Attach procedures that have been rejected due to APN restriction in the MME. The counter is incremented when an Attach Reject combined with a PDN Connectivity Reject message is sent to the UE because the resolved APN is restricted from EPS services by local configuration in the MME.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachrejectduetoapnrestriction_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachRejectDueToApnRestriction.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachrejectduetoattachthrottling_e','vs_mm_attachrejectduetoattachthrottling_e',36,'counter','integer','CC','0','This measurement provides the number of E-UTRAN attach procedures that have been rejected due to the Attach Throttling function. The counter is incremented when an Attach procedure is rejected because the available allowance has been exceeded. The available allowance for E-UTRAN attach procedures is the difference between the total Attach throttle allowance, specified by the MMEAttachThrottlingAttachRateLimit parameter and the reserved allowance for Geographically Redundant UE Restoration Procedures specified by the MMEAttachThrottlingReservedLimitGeoredRestore parameter.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachrejectduetoattachthrottling_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachRejectDueToAttachThrottling.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachsuccwithoutpdn_e','vs_mm_attachsuccwithoutpdn_e',37,'counter','integer','CC','0','This measurement provides the number of successful Attach procedures, after which the attached UE is in the EMM-REGISTERED state without PDN connection.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachsuccwithoutpdn_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachSuccWithoutPDN.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachthrottlingnonreservedgrantedattach_e','vs_mm_attachthrottlingnonreservedgrantedattach_e',38,'counter','integer','CC','0','This measurement provides the number of E-UTRAN attach procedures that have been accepted by the Attach throttle using the non-reserved allowance. The non-reserved allowance is the difference between the total Attach throttle allowance, specified by the MMEAttachThrottlingAttachRateLimit parameter, and the sum of the reserved allowances, specified by the MMEAttachThrottlingReservedLimitAttach and MMEAttachThrottlingReservedLimitGeoredRestore parameters. E-UTRAN attach procedures accepted using the reserved Attach allowance specified by the MMEAttachThrottlingReservedLimitAttach parameter are not counted.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachthrottlingnonreservedgrantedattach_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachThrottlingNonReservedGrantedAttach.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachupbyconfigwhenuereqcp_e','vs_mm_attachupbyconfigwhenuereqcp_e',39,'counter','integer','CC','0','This measurement provides the number of successful Attach Procedures with the SGi IP PDN connection established over user plane because the MME local policy permits user plane for the UE supporting the control plane CIoT EPS optimization and S1-U data transfer while the UE prefers control plane CIoT EPS optimization.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachupbyconfigwhenuereqcp_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachUpByConfigWhenUeReqCp.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachuscdiscarded_e','vs_mm_attachuscdiscarded_e',40,'counter','integer','CC','0','This measurement provides the amount of Attach Request messages discarded by the MME due to UE Signaling Control. The counter increases if a message is discarded when the UE Signaling Control rule is in measurement and control mode. Messages are discarded if the value of the ThresholdNumber parameter is exceeded within a measurement interval. The ThresholdNumber parameter is configured in the UE Signaling Control rule.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachuscdiscarded_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachUscDiscarded.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachuscrejected_e','vs_mm_attachuscrejected_e',41,'counter','integer','CC','0','This measurement provides the amount of Attach Request messages that are controlled by the UE Signaling Control feature with the reject action. The counter applies only when the UE Signaling Control feature is activated in the Measurement and Control mode. The counter is increased whenever an Attach Request message is identified and controlled by UE Signaling Control with the reject action during a control period.');
