INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachwithesmdummyatt_e','vs_mm_attachwithesmdummyatt_e',42,'counter','integer','CC','0','This measurement provides the number of attempted Attach procedures with an ESM dummy message contained in the ESM message container IE in the Attach Request message.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_attachwithesmdummyatt_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.AttachWithESMDummyAtt.E');
