INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_connectionresumefailure_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.ConnectionResumeFailure.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_connectionresumefailureduetoapnrestriction_e','vs_mm_connectionresumefailureduetoapnrestriction_e',46,'counter','integer','CC','0','This measurement provides the number of Connection Resume procedures that have failed due to APN restriction in the MME. The counter is incremented when an S1-AP UE Context Resume Failure message is sent to the eNodeB or an X2-based Handover procedure with RRC Cause Resume is rejected or aborted because all the APNs in the EPS Bearer Context stored for the UE are restricted from EPS services by local configuration in the MME.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_connectionresumefailureduetoapnrestriction_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.ConnectionResumeFailureDueToApnRestriction.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_connectionsuspend_e','vs_mm_connectionsuspend_e',47,'counter','integer','CC','0','This measurement provides the number of Connection Suspend procedures. The counter is incremented when an S1-AP UE Context Suspend Request message is received from the eNodeB.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_connectionsuspend_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.ConnectionSuspend.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_controlplaneservicereqnascongestioncontrolrejected_e','vs_mm_controlplaneservicereqnascongestioncontrolrejected_e',48,'counter','integer','CC','0','This measurement provides the number of reject messages with T3346 and EMM cause code 22 (Congestion) sent by the MME. The MME sends the reject messages in response to Control Plane Service Request due to the NAS Level Mobility Management Congestion Control based on the UE priority.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_controlplaneservicereqnascongestioncontrolrejected_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.ControlPlaneServiceReqNasCongestionControlRejected.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_controlplaneservicerequestatt_e','vs_mm_controlplaneservicerequestatt_e',49,'counter','integer','CC','0','This measurement provides the number of attempted Control Plane Service Request procedures. It is incremented when an S1 Control Plane Service Request message is received from the UE.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_controlplaneservicerequestatt_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.ControlPlaneServiceRequestAtt.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_controlplaneservicerequestfail_e','vs_mm_controlplaneservicerequestfail_e',50,'counter','integer','CC','0','This measurement provides the number of unsuccessfulControl Plane Service Request procedures. It is incremented when an S1 Service Reject message is sent in response to a Control Plane Service Request.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_controlplaneservicerequestfail_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.ControlPlaneServiceRequestFail.E');
