INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_csfbpagingatt_e','vs_mm_csfbpagingatt_e',52,'counter','integer','CC','0','This measurement provides the number of attempted #CS# fallback paging procedures due to #MT# call, initiated at the #MME# over the S1-MME interface. The counter is incremented when a #CS# fallback paging procedure is started, that is at the transmission of the first paging message in the procedure. The paging procedure consists of one or more paging messages with the current S-TMSI. A new set of paging messages, triggered by a new #MT# call from an #MSC/VLR# is regarded as a new procedure.');
