INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intrataunascongestioncontrolrejected_e','vs_mm_intrataunascongestioncontrolrejected_e',101,'counter','integer','CC','0','This measurement provides the number of reject messages with T3346 and EMM cause code 22 (Congestion) sent by the MME. The MME sends the reject messages in response to Intra-TAU Request due to the NAS Level Mobility Management Congestion Control based on the UE priority.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intrataunascongestioncontrolrejected_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.IntraTAUNasCongestionControlRejected.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intratauuscdetached_e','vs_mm_intratauuscdetached_e',102,'counter','integer','CC','0','This measurement provides the amount of TAU Request messages of Intra-MME TAU that are controlled by the UE Signaling Control feature with the detach action. The counter applies only when the UE Signaling Control feature is activated in the Measurement and Control mode. The counter is increased whenever a TAU Request message of Intra-MME TAU is identified and controlled by UE Signaling Control with the detach action during a control period.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intratauuscdetached_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.IntraTAUUscDetached.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intratauuscdiscarded_e','vs_mm_intratauuscdiscarded_e',103,'counter','integer','CC','0','This measurement provides the amount of intra-MME Tracking Area Update Request messages discarded by the MME due to UE Signaling Control. The counter increases if a message is discarded when the UE Signaling Control rule is in measurement and control mode. Messages are discarded if the value of the ThresholdNumber parameter is exceeded within a measurement interval. The ThresholdNumber parameter is configured in the UE Signaling Control rule.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intratauuscdiscarded_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.IntraTAUUscDiscarded.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intratauuscrejected_e','vs_mm_intratauuscrejected_e',104,'counter','integer','CC','0','This measurement provides the amount of TAU Request messages of Intra-MME TAU that are controlled by the UE Signaling Control feature with the reject action. The counter applies only when the UE Signaling Control feature is activated in the Measurement and Control mode. The counter is increased whenever a TAU Request message of Intra-MME TAU is identified and controlled by UE Signaling Control with the reject action during a control period.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intratauuscrejected_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.IntraTAUUscRejected.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intrataurejectduetoapnrestriction_e','vs_mm_intrataurejectduetoapnrestriction_e',105,'counter','integer','CC','0','This measurement provides the number of Intra-MME TAU with Active Flag or Signalling Active Flag procedures that have been rejected due to APN restriction in the MME. The counter is incremented when a TAU Reject message is sent to the UE because all the APNs in the EPS Bearer Context stored for the UE are restricted from EPS services by local configuration in the MME.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_intrataurejectduetoapnrestriction_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.IntraTauRejectDueToApnRestriction.E');
