INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_locationreport_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.LocationReport.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_locationreportcontrolchangeofservicecell_e','vs_mm_locationreportcontrolchangeofservicecell_e',107,'counter','integer','CC','0','This measurement provides the number of Location Reporting procedures initiated by the MME due to the change of a service cell. This counter is incremented each time the MME sends a Location Reporting Control or Handover Request message with the "Change of Service Cell" request type.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_locationreportcontrolchangeofservicecell_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.LocationReportControlChangeOfServiceCell.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_locationreportcontrolmtlr_e','vs_mm_locationreportcontrolmtlr_e',108,'counter','integer','CC','0','This measurement provides the number of Location Reporting Control messages sent by the #MME# to the eNodeB during Mobile Terminated Location Request procedures.This counter is incremented each time the MME sends a Location Reporting Control message to the eNodeB during a Mobile Terminated Location Request procedure.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_locationreportcontrolmtlr_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.LocationReportControlMtlr.E');
