INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_locationupdatesucc_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.LocationUpdateSucc.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_mocsfbattinnocsservicearea_e','vs_mm_mocsfbattinnocsservicearea_e',114,'counter','integer','CC','0','This measurement provides the number of MO CS call attempts when the CombinedRegistrationSetting parameter is set to dummy_cs_service and the #UE# is in no CSFB service area. This counter is incremented each time an MO CS call is rejected because of no CSFB service area.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_mocsfbattinnocsservicearea_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.MoCsfbAttInNoCsServiceArea.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_mosmsattinnocsservicearea_e','vs_mm_mosmsattinnocsservicearea_e',115,'counter','integer','CC','0','This measurement provides the number of MO SMS attempts when the CombinedRegistrationSetting parameter is set to dummy_cs_service and the #UE# is in no CS service area. This counter is incremented each time an MO SMS is ignored  because of no CS service area.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_mosmsattinnocsservicearea_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.MoSMSAttInNoCsServiceArea.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbpagingatt_e','vs_mm_nbpagingatt_e',116,'counter','integer','CC','0','This measurement provides the total number of attempted Paging procedures initiated for UEs in Tracking Areas with RAT type NB-IoT. The counter is incremented when a Paging message is sent to the eNodeB at the first transmission. Retransmissions of the same Paging message are not counted.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbpagingatt_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NBPagingAtt.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbpagingsucc_e','vs_mm_nbpagingsucc_e',117,'counter','integer','CC','0','This measurement provides the total number of successful paging procedures initiated for UEs in Tracking Areas with RAT type NB-IoT. This measurement is incremented irrespective of the paging being an initial paging request or the resending of paging request. The counter is incremented when a Control Plane Service Request message, or any NAS message, is received from the UE.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbpagingsucc_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NBPagingSucc.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedemc_e','vs_mm_nbractattachedemc_e',118,'counter','integer','GAUGE','0','This measurement provides the number of currently attached #UE# within this #MME# area for #IMS# Emergency Service only. The gauge will be incremented or decremented when the #UE# enters or leaves the #MME# with only #IMS# Emergency Service, for example, due to Attach, Inter-#MME# mobility, Detach or Implicit Detach. This gauge will also be increased if an attached user with an additional EMC PDN looses its non-emergency PDNs due to, for example, Roaming restrictions, and then ends up with only IMS Emergency Service.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedemc_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrActAttachedEmc.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedemcunauth_e','vs_mm_nbractattachedemcunauth_e',119,'counter','integer','GAUGE','0','This measurement provides the number of currently unauthenticated attached UEs within this MME area for IMS emergency service only. The gauge will be incremented or decremented when an unauthenticated UE enters or leaves the MME with only IMS Emergency Service, for example, due to Attach, Inter-MME mobility, Detach or Implicit Detach.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedemcunauth_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrActAttachedEmcUnauth.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsub_e','vs_mm_nbractattachedsub_e',120,'counter','integer','GAUGE','0','This measurement provides the number of currently attached #EPS# subscribers within this #MME# area. The gauge will be incremented or decremented when the #UE# enters or leaves the #MME#, for example, due to Attach, Inter-#MME# #TA# Update, Detach or Implicit Detach. 
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsub_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrActAttachedSub.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsubcatm1_e','vs_mm_nbractattachedsubcatm1_e',121,'counter','integer','GAUGE','0','This measurement provides the number of currently attached UEs that are Cat-M1 and leave or enter the #AP# within an #MME# area. The gauge is incremented when the UE enters the state emm_registered and the #UE# is a Cat-M1 device, or when the #UE# is in the emm_registered state and the #MME# identifies the #UE# as a Cat-M1 device. The #MME# identifies a #UE# as a Cat-M1 device when it receives a UE CAPABILITY INFO INDICATION message indicating that the #UE# is a Cat-M1 device. The transmission of the UE CAPABILITY INFO INDICATION message is triggered by, for example, Attach, Handover, or Service Request.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsubcatm1_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrActAttachedSubCatM1.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsubconnectionsuspend_e','vs_mm_nbractattachedsubconnectionsuspend_e',122,'counter','integer','GAUGE','0','This measurement provides the number of currently attached UEs granted use of the Connection Suspend and Resume feature. The gauge is incremented when a UE granted use of the Connection Suspend and Resume feature attaches to or moves into the MME. The gauge is decremented when a UE granted use of the Connection Suspend and Resume feature detaches from or moves out of the MME.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsubconnectionsuspend_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrActAttachedSubConnectionSuspend.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsubdonas_e','vs_mm_nbractattachedsubdonas_e',123,'counter','integer','GAUGE','0','This measurement provides the number of currently attached UEs using the Data over NAS feature. The gauge is incremented when a UE using the Data over NAS feature attaches to or moves into the MME. The gauge is decremented when a UE using the Data over NAS feature detaches from or moves out of the MME.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsubdonas_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrActAttachedSubDoNas.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsublapi_e','vs_mm_nbractattachedsublapi_e',124,'counter','integer','GAUGE','0','This measurement provides the number of attached UEs that are configured for low access priority. The gauge is incremented or decremented when the low access priority UE enters or leaves the MME, for example, due to Attach, Inter-MME TA Update, Detach or Implicit Detach. 
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbractattachedsublapi_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrActAttachedSubLapi.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrattachednr_e','vs_mm_nbrattachednr_e',125,'counter','integer','GAUGE','0','This measurement provides the number of currently attached #NR# capable and not #NR# restricted #UEs#. The gauge is incremented when an #NR# capable and not #NR# restricted #UE# enters the #MME#. The gauge is decremented when an #NR# capable and not #NR# restricted #UE# leaves the #MME#.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrattachednr_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrAttachedNr.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrattachednrcapable_e','vs_mm_nbrattachednrcapable_e',126,'counter','integer','GAUGE','0','This measurement provides the number of currently attached #NR# capable #UEs#. The gauge is incremented when an #NR# capable #UE# enters the #MME#. The gauge is decremented when an #NR# capable #UE# leaves the #MME#.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrattachednrcapable_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrAttachedNrCapable.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrattachedpsm_e','vs_mm_nbrattachedpsm_e',127,'counter','integer','GAUGE','0','This measurement provides the number of #UEs# currently in Power Saving Mode (PSM). The gauge is incremented when a #UE# enters PSM, that is when the active timer expires and the implicit detach timer is started. The gauge is decremented when a #UE# leaves PSM, that is when any kind of signaling from the #UE# is received or when the #UE# is implicitly detached.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrattachedpsm_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrAttachedPsm.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrconnectionsuspendedsub_e','vs_mm_nbrconnectionsuspendedsub_e',128,'counter','integer','GAUGE','0','This measurement provides the number of suspended UE contexts. The gauge is incremented when a UE context is suspended as a result of a successful Connection Suspend procedure. The gauge is decremented when a UE context is resumed as a result of a successful Connection Resume procedure, or when the MME receives signaling from the UE. It is also decremented when a UE context is released as a result of an S1 Release procedure, or when the UE is detached.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrconnectionsuspendedsub_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrConnectionSuspendedSub.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrcsattachedsub_e','vs_mm_nbrcsattachedsub_e',129,'counter','integer','GAUGE','0','This measurement provides the current number of SGs associated subscribers within this #MME#. The gauge is incremented at each successful initial registration for a #UE# towards an #MSC/VLR#.  The gauge is decremented each time a #UE# is #IMSI# detached.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrcsattachedsub_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrCsAttachedSub.E');
