INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrdisconnectedenodeb_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrDisconnectedeNodeB.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrecmconnectedsub_e','vs_mm_nbrecmconnectedsub_e',131,'counter','integer','GAUGE','0','This measurement provides the number of subscribers in the ECM-CONNECTED state.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrecmconnectedsub_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrEcmConnectedSub.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrhomesub_e','vs_mm_nbrhomesub_e',132,'counter','integer','GAUGE','0','This measurement provides the number of #EPS# home subscribers located in the MME location register. The #EMM# state of this subscriber is EMM_REGISTERED or EMM_DEREGISTERED. Only #EPS# subscribers that are homed in the same #EPS# network are considered.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrhomesub_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrHomeSub.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrsdsattachedsub_e','vs_mm_nbrsdsattachedsub_e',133,'counter','integer','GAUGE','0','This measurement provides the number of subscribers on the MME that are registered on an SDS GW through the SGs-Lite interface. The gauge is incremented when a UE newly registers in the MME and the MME receives an SGSLite-LOCATION-UPDATE-ACK message with cause code "success" from an SDS GW, for example, in the Attach, Inter-TAU, GEO recovery, and Move (target side) procedures. The gauge is decremented when the MME sends an SGSLite-IMSI-DETACH-INDICATION message to an SDS GW.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrsdsattachedsub_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrSdsAttachedSub.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrsmsinmmeregisteredsub_e','vs_mm_nbrsmsinmmeregisteredsub_e',134,'counter','integer','GAUGE','0','This measurement provides the number of registered subscribers for which the MME has successfully performed the SMS in MME registration.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrsmsinmmeregisteredsub_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrSmsInMmeRegisteredSub.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrsubemmregisteredwithoutpdn_e','vs_mm_nbrsubemmregisteredwithoutpdn_e',135,'counter','integer','GAUGE','0','This measurement provides the number of currently attached UEs in the EMM-REGISTERED state without PDN connection. The gauge is incremented when the UE changes into the EMM-REGISTERED state without PDN connection, because of, for example, Attach, Inter-MME TAU procedures without PDN connection, or deactivation of the last PDN connection. The gauge is decremented when the UE leaves the EMM-REGISTERED state without PDN connection, because of, for example, Detach or Inter-MME mobility procedures or Implicit Detach, or activation of the first PDN connection for the UE in EMM-REGISTERED.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrsubemmregisteredwithoutpdn_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrSubEmmRegisteredWithoutPDN.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrsubsupportemmregisteredwithoutpdn_e','vs_mm_nbrsubsupportemmregisteredwithoutpdn_e',136,'counter','integer','GAUGE','0','This measurement provides the number of currently attached UEs supporting EMM-REGISTERED without PDN connection. The gauge is incremented when the UE supporting EMM-REGISTERED without PDN connection changes into the EMM-REGISTERED state, because of, for example,  Attach or Inter-MME TAU procedures. The gauge is decremented when the UE supporting EMM-REGISTERED without PDN connection changes into the EMM-DEREGISTERED state leaves the EMM-REGISTERED state, because of, for example, Detach or Implicit Detach or Inter-MME mobility procedures.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrsubsupportemmregisteredwithoutpdn_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrSubSupportEmmRegisteredWithoutPDN.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrvisitingforeign_e','vs_mm_nbrvisitingforeign_e',137,'counter','integer','GAUGE','0','This measurement provides the number of international roaming subscribers in the #MME#, where the #MCC# in the #IMSI# number is not part of the #PLMN#s supported by the #MME#. The #EPS# #MM# state of these subscribers is EMM_REGISTERED or EMM_DEREGISTERED.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrvisitingforeign_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrVisitingForeign.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrvisitingnatsub_e','vs_mm_nbrvisitingnatsub_e',138,'counter','integer','GAUGE','0','This measurement provides the number of national roaming subscribers in the #MME#, where the #MCC# in the #IMSI# number is one of the #MCC#s of the #PLMN#s supported by the #MME#. The #EPS# #MM# state of these subscribers is EMM_REGISTERED or EMM_DEREGISTERED.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nbrvisitingnatsub_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NbrVisitingNatSub.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nonbroadcastedlaiused_e','vs_mm_nonbroadcastedlaiused_e',139,'counter','integer','CC','0','This measurement provides the number of times for which the Old location area identifier IE is filled with the non-broadcasted LAI in the Location Update Request message sent from the MME to an MSC.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_nonbroadcastedlaiused_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.NonBroadcastedLAIUsed.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_pagingavoidedduetoueinpsm_e','vs_mm_pagingavoidedduetoueinpsm_e',140,'counter','integer','CC','0','This measurement provides the number of paging procedures in #EPS# that have been avoided due to the #UE# being in Power Saving Mode (PSM). The counter is increased when paging is needed, but cannot be performed since the #UE# is in PSM and unreachable.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E:vs_mm_pagingavoidedduetoueinpsm_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_MOBILITY_MM_E','SGSN-MME_Mobility_MM_E','VS.MM.PagingAvoidedDueToUeInPsm.E');
