INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER:sctpassocreestablishmentatt','sctpassocreestablishmentatt',9,'counter','integer','CC','0','This measurement provides the number of SCTP association reestablishment attempts on the S1-MME and SBc interfaces. The number of reestablishment attempts are calculated per SctpUserId, that is, per interface. Also see counters sctpAssocReestablishmentSuccLocal and sctpAssocReestablishmentSuccRemote.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER:sctpassocreestablishmentatt','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER','SGSN-MME_SCTPUser','sctpAssocReestablishmentAtt');
