INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER:sctpassocreestablishmentsucclocal','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER','SGSN-MME_SCTPUser','sctpAssocReestablishmentSuccLocal');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER:sctpassocreestablishmentsuccremote','sctpassocreestablishmentsuccremote',11,'counter','integer','CC','0','This measurement provides the number of successful SCTP association reestablishment attempts on the S1-MME and SBc interfaces with the remote node, eNodeB or CBC, as the source of the establishment of the SCTP association. This case occurs when both SGSN-MME and the remote node tries to reestablish the association, and as SGSN-MME on the S1-MME and SBc interfaces acts as server, the SCTP association established from the remote node will be preferred. The number of successful reestablishment attempts are calculated per SctpUserId, that is, per interface. Also see counters sctpAssocReestablishmentSuccLocal and sctpAssocReestablishmentAtt.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER:sctpassocreestablishmentsuccremote','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SCTPUSER','SGSN-MME_SCTPUser','sctpAssocReestablishmentSuccRemote');
