INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI:vs_sm_creatededicatedbearerqcisucc_e','vs_sm_creatededicatedbearerqcisucc_e',11,'counter','integer','CC','0','This measurement provides the number of successful EPS Bearer Activations for dedicated bearers with the indexed QCI on S11, initiated from SGW/PGW towards MME. For each successful Create Bearer Request for the indexed QCI(s), this counter is incremented with the number of successful bearers included in the request.');
