INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI:vs_sm_enbormmeinitdeletebearerqciatt_e','vs_sm_enbormmeinitdeletebearerqciatt_e',12,'counter','integer','CC','0','This measurement provides the number of attempted Bearer Deactivation procedures initiated by the eNodeB, or the MME indexed per QCI. The counter is incremented when the MME sends a Delete Bearer Command message over S11 to the SGW, or when the MME sends a Delete Session Request over S11 to SGW. Both default and dedicated bearers are counted, as well as the dedicated bearers that are implicitly deleted when a default bearer is deleted. The measurement will exclude the scenarios where UE triggers the procedure.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI:vs_sm_enbormmeinitdeletebearerqciatt_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI','SGSN-MME_Session_SM_E_QCI','VS.SM.EnbOrMmeInitDeleteBearerQCIAtt.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI:vs_sm_enbormmeinitdeletebearerqcisucc_e','vs_sm_enbormmeinitdeletebearerqcisucc_e',13,'counter','integer','CC','0','This measurement provides the number of successful Bearer Deactivation procedures initiated by the eNodeB, or the MME indexed per QCI. The counter is incremented when the MME sends a Delete Bearer Response over S11 to SGW, having already sent a Delete Bearer Command to SGW, or when the MME receives a Delete Session Response over S11 from SGW. Both default and dedicated bearers are counted, as well as the dedicated bearers that are implicitly deleted when a default bearer is deleted. MME will internally remove the successful and unsuccessful bearers after the MME sends a Delete Bearer Command or a Delete Session Request. The measurement will exclude the scenarios where UE triggers the procedure.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI:vs_sm_enbormmeinitdeletebearerqcisucc_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_SESSION_SM_E_QCI','SGSN-MME_Session_SM_E_QCI','VS.SM.EnbOrMmeInitDeleteBearerQCISucc.E');
