INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_nbrattachedecue_g','vs_m2m_nbrattachedecue_g',8,'counter','integer','GAUGE','0','This measurement provides the number of currently attached Extended Coverage (EC)-GSM IoT mode UEs. The gauge is incremented when an EC-GSM IoT mode UE sets the Coverage Class, for example during attach. The gauge is decremented when an EC-GSM IoT mode is detached or no longer has a Coverage Class set.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_nbrattachedecue_g','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','SGSN-MME_M2M_G','VS.M2M.NbrAttachedEcUe.G');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_nbrattachededrxue_g','vs_m2m_nbrattachededrxue_g',9,'counter','integer','GAUGE','0','This measurement provides the number of currently attached UEs using Extended Idle Mode Discontinuous Reception (eDRX). The gauge is incremented when a UE using eDRX attaches to or moves into SGSN. The gauge is decremented when a UE detaches from or moves out of SGSN, or deactivates eDRX.
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_nbrattachededrxue_g','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','SGSN-MME_M2M_G','VS.M2M.NbrAttachedEdrxUe.G');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_pagingecueatt_g','vs_m2m_pagingecueatt_g',10,'counter','integer','CC','0','This measurement provides the total number of attempted Paging procedures initiated for Extended Coverage (EC)-GSM IoT mode UEs. The counter is incremented when the first Paging message is sent. Retransmissions of the same Paging message are not counted.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_pagingecueatt_g','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','SGSN-MME_M2M_G','VS.M2M.PagingEcUeAtt.G');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_pagingecuesucc_g','vs_m2m_pagingecuesucc_g',11,'counter','integer','CC','0','This measurement provides the total number of successful Paging procedures initiated for Extended Coverage (EC)-GSM IoT mode UEs. The counter is incremented when a Paging Response is received from the UE and when a message the UE sends is regarded as a Paging Response during the Paging procedure.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_pagingecuesucc_g','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','SGSN-MME_M2M_G','VS.M2M.PagingEcUeSucc.G');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_M2M_G:vs_m2m_pagingedrxueatt_g','vs_m2m_pagingedrxueatt_g',12,'counter','integer','CC','0','This measurement provides the total number of attempted paging procedures initiated for the UEs with Extended Idle Mode Discontinuous Reception (eDRX) mode activated. The counter is incremented when an eDRX Paging PS message is sent to the BSC. That is at the transmission of the first eDRX Paging PS message and retransmission is not counted.');
