INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_IOT_MM_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_IOT_MM_E:vs_iot_mm_attachuscdiscarded_nb','vs_iot_mm_attachuscdiscarded_nb',12,'counter','integer','CC','0','This measurement provides the amount of Attach Request messages discarded by the MME for UEs using RAT type NB-IoT due to UE Signaling Control. The counter increases if a message is discarded when the UE Signaling Control rule is in measurement and control mode. Messages are discarded if the value of the ThresholdNumber parameter is exceeded within a measurement interval. The ThresholdNumber parameter is configured in the UE Signaling Control rule.');
