INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_POOL_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_POOL_E:vs_pool_attachthrottlingnonreservedgranted_e','vs_pool_attachthrottlingnonreservedgranted_e',9,'counter','integer','CC','0','This measurement provides the number of Update Location Request (ULR) and Authentication Information Request (AIR) messages due to the Pool Move procedure that have been accepted by the Attach throttle using the non-reserved allowance. The non-reserved allowance is the difference between the total Attach throttle allowance, specified by the MMEAttachThrottlingAttachRateLimit parameter, and the sum of the reserved allowances, specified by the MMEAttachThrottlingReservedLimitAttach and MMEAttachThrottlingReservedLimitGeoredRestore parameters. ULR and AIR messages accepted using the reserved Pool Move allowance specified by the MMEAttachThrottlingReservedLimitGeoredRestore parameter are not counted."');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_POOL_E:vs_pool_attachthrottlingnonreservedgranted_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_POOL_E','SGSN-MME_Pool_E','VS.Pool.AttachThrottlingNonReservedGranted.E');
INSERT INTO reportable_entity_columns VALUES ('PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_POOL_E','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_POOL_E:vs_pool_s6ablockbythrottle_e','vs_pool_s6ablockbythrottle_e',10,'counter','integer','CC','0','This measurement provides the number of S6a messages blocked due to the Attach Throttling function during Pool Move. The counter is incremented when an S6a message is blocked because the number of messages under throttling control exceeds the available allowance. The available allowance for Pool Move procedure messages is the difference between the total Attach throttle allowance, specified by the MMEAttachThrottlingAttachRateLimit parameter and the reserved allowance for E-UTRAN attach procedures, specified by the MMEAttachThrottlingReservedLimitAttach parameter.');
INSERT INTO reportable_entity_column_source VALUES ('PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_POOL_E:vs_pool_s6ablockbythrottle_e','PM_E_SGSNMME_5_38','PM_E_SGSNMME_5_38:PM_E_SGSNMME_SGSN_MME_POOL_E','SGSN-MME_Pool_E','VS.Pool.S6aBlockByThrottle.E');
